# Check commutativity
def check_commutativity(stabs):
    paulis = [stim.PauliString(s) for s in stabs]
    collisions = []
    for i in range(len(paulis)):
        for j in range(i + 1, len(paulis)):
            if not paulis[i].commutes(paulis[j]):
                collisions.append((i, j))
    return collisions

